import React, { useEffect, useState } from 'react';
import { useNavigate, useLocation } from "react-router-dom";
import api from '../utils/api';
import { useFieldContext } from '../contexts/FieldContext';

const DashboardContent = () => {
    const { filter, sortBy, sortOrder, searchTerm } = useFieldContext();

    // ✅ Логуємо значення з контексту при кожному рендері (коли вони можуть змінитися)
    console.log("DashboardContext values:", { filter, sortBy, sortOrder, searchTerm });

    const [fields, setFields] = useState([]);
    const navigate = useNavigate();
    const location = useLocation();

    useEffect(() => {
        api.get('/fields')
            .then(response => {
                // ✅ Логуємо дані, отримані від API
                console.log("API fetched fields:", response.data);
                setFields(response.data);
            })
            .catch(error => console.error('Error fetching fields:', error));
    }, [sortBy, sortOrder, filter]); // Залежності: перевідправляти запит при зміні сортування/фільтру/пошуку

    const searchedFields = fields.filter(field =>
        field.name.toLowerCase().includes(searchTerm.toLowerCase())
    );
    // ✅ Логуємо результат пошуку
    console.log("Searched fields:", searchedFields);


    const filteredFields = searchedFields.filter(field => {
        if (filter === "all") return true;
        // ✅ Перевірте тут, чи властивість field.selected існує і має очікуваний тип (boolean)
        if (filter === "active") return field.selected === true;
        if (filter === "inactive") return field.selected === false;
        return true;
    });
    // ✅ Логуємо результат фільтрації
    console.log("Filtered fields:", filteredFields);


    const sortedFields = [...filteredFields].sort((a, b) => {
        if (sortBy === "name") {
            return sortOrder === "asc" ? a.name.localeCompare(b.name) : b.name.localeCompare(a.name);
        }
        if (sortBy === "area") {
            // ✅ Перевірте тут, чи властивість field.area існує і є числом
            return sortOrder === "asc" ? a.area - b.area : b.area - a.area; // сортуємо за area (розмір)
        }
        if (sortBy === "created_at") {
            // ✅ Перевірте тут, чи властивість field.created_at існує і є коректним форматом дати
            return sortOrder === "asc"
                ? new Date(a.created_at) - new Date(b.created_at) // сортуємо за created_at (дата)
                : new Date(b.created_at) - new Date(b.created_at);
        }
        return 0;
    });
    // ✅ Логуємо результат сортування
    console.log("Sorted fields:", sortedFields);


    const getFieldNavigationPath = (fieldId) => {
        if (location.pathname.startsWith('/analytics')) {
            return `/analytics/field/${fieldId}`;
        }
        return `/field/${fieldId}`;
    };


    return (
        <div id="dash-content" className="bg-gray-200 py-6 lg:py-0 w-full lg:max-w-sm flex flex-wrap content-start overflow-y-auto max-h-screen">
            {/* Рендеримо відсортовані та відфільтровані поля */}
            {/* ✅ Використовуємо sortedFields */}
            {sortedFields.length === 0 && fields.length > 0 && (
                // Повідомлення, якщо після фільтрації/пошуку нічого не знайдено, але початковий список не порожній
                <p className="text-center w-full text-gray-500">Нічого не знайдено за заданими критеріями.</p>
            )}
            {fields.length === 0 && (
                // Повідомлення, якщо початковий список полів порожній
                <p className="text-center w-full text-gray-500">Поля не знайдені.</p>
            )}

            {/* ✅ Мапаємо sortedFields */}
            {sortedFields.map(field => (
                <div key={field.id} className="w-1/2 lg:w-full">
                    {/* ... решта JSX коду для відображення поля ... */}
                    <div
                        onClick={() => navigate(getFieldNavigationPath(field.id))}
                        className="cursor-pointer border-2 border-gray-400 border-dashed hover:border-transparent hover:bg-white hover:shadow-xl rounded p-6 m-2 md:mx-10 md:my-6 relative transition duration-200"
                    >
                        {/* Іконка редагування */}
                        <button
                            onClick={(e) => {
                                e.stopPropagation(); // блокуємо основний клік
                                navigate(`/field/${field.id}/edit`); // редагування поля
                            }}
                            className="absolute top-3 right-3 text-gray-500 hover:text-indigo-600"
                            title="Редагувати поле"
                        >
                            <i className="fas fa-edit text-xl"></i>
                        </button>

                        {/* Контент */}
                        <div className="flex flex-col items-center">
                            <div className="flex-shrink ">
                                <div className="rounded-full p-3 bg-gray-300">
                                    <i className="fa fa-seedling fa-fw fa-inverse text-indigo-500"></i>
                                </div>
                            </div>
                            <div className="flex-1 text-center">
                                <h3 className="font-bold text-2xl">{field.name}</h3>
                                <h5 className="font-bold text-gray-500">{field.description}</h5> {/* Переконайтесь, що description існує */}
                            </div>
                        </div>
                    </div>
                </div>
            ))}
        </div>
    );
};

export default DashboardContent;
